import axios from "axios";
import { useState, useEffect} from "react";
import './App.css';
import useAlgo from "./useAlgo.js"

export default function App() {

    var url = './Food3.json'

    function Verify1() {
      url = './popularpoll.json'
      alert("Popular Algo")
      useAlgo(url)

    }
    function Verify2() {
      url = ''
      alert("Fresh Algo")
      useAlgo(url)
    }
    function Verify3() {
      url = './Food3.json'
      alert("Random Algo")
      useAlgo(url)
    }


    return (
      <div className="App">
      <button id="btn1" onClick={Verify1}>Popular</button>
        <button id="btn2" onClick={Verify2}>Fresh</button>
        <button id="btn2" onClick={Verify3}>Random</button>
      </div>

    )
}
